  \"Mid-Columbia - Mapping of Invasive Plants and Monitoring of Efficacy and Impacts
  in Support of Invasive Control and Rehabilitation Projects 2015\",\n\t\"tracking_summary\":
  {\n\t\t\"total\": 1,\n\t\t\"recent\": 1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2016-08-20T09:39:37.734032\",\n\t\"name\": \"mid-columbia-mapping-of-invasive-plants-and-monitoring-of-efficacy-and-impacts-in-support-\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The proposed project will be to hire and
  train a volunteer invasives mapping and monitoring crew for two primary purposes.
  The first will be to locate and map populations of invasive plants as part of a
  larger station-sponsored program to describe and treat multiple invasive species
  on Complex refuges. This larger station-sponsored program involves the formation
  and support of a weed treatment u201cstrike team.u201d The mapping efforts will
  be used to document and describe infestations and to reduce the strike teamu2019s
  search times, increasing their ability to control targeted species at the best biological
  time. The second purpose will be to collect efficacy and impact information from
  past treatments, including past strike team efforts and other station-sponsored
  projects. Training of the volunteers in the operation of GPS equipment, weed identification,
  monitoring protocols, and data management will also develop a pool of trained individuals
  for future invasive plant management activities. GPS/GIS technologies and a customized
  data dictionary will be used to inventory and map the location of invasive species
  populations on refuge lands. The combination of the proposed project and the station-sponsored
  strike team will help document, monitor, and reduce the incidence of invasive species
  on refuge lands as a step in the recovery of native shrub-steppe, wetland, and riparian
  habitats, and will help to evaluate and inform refuge management actions.\",\n\t\"license_title\":
